function App() {

  return (

    <Router>

      {/* Ruta a la pagina de consulta y seleccion de productos */}
      <Route path = "/solicitud" component = {Main}></Route>

      {/*<Route path = "/solicitud/:data" component = {PedidoEnCurso}></Route>*/}      

    </Router>
  );
}

